import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {


    return (
        <nav className="navbar">
            <h3>
                <Link to="/">EmotiChat</Link>
            </h3>
            <div>
                {user ? (
                    <button onClick={signout} className="sign-out" type="button">
                        Sign Out
                    </button>
                ): 
                (
                    <>
                        <Link to="/login">Sign In</Link>
                        
                    </>
                    
                )}
                                
            </div>
            
        </nav>
    );
};

export default Navbar;
